import Layout from '../components/Layout';
import Navigation from '../components/Navigation';
import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

function IndexPage() {
    return (
      <>
        <Layout>
          <Navigation />
          <div className="items-center justify-center pt-32 px-8 pb-20 md:px-20 lg:p-32 xl:py-24">
            <div class="container mx-auto flex flex-wrap flex-col md:flex-row items-center"> 
                <div class="flex flex-col w-full md:w-2/5 self-center justify-center items-start text-center md:text-left">
                    <p class="uppercase tracking-loose w-full text-base m-2">Junior front end developer</p>
                    <h1 class="my-4 font-bold leading-tight text-5xl m-2">Rosalie Prom</h1>
                    <p class="leading-normal mb-8 text-lg m-2">
                        Hi, I'm an aspiring full stack developer who really likes React and Javascript. 
                    </p>
                </div>
            </div>
          </div>
        </Layout>
      </>
    )
  }

  export default IndexPage;
